import React from 'react'
import {Link} from 'react-router-dom';
import {search,makeNode,add} from '../trie.js'
import { connect } from 'react-redux';
 function Navbar({products}) {
    
    const root=new makeNode('r');
    products.array.forEach(element => {
        add(element.longName);
    });
    return (
        <div className="nav-bar">
           <Link style={{textDecoration:'none',color:'whitesmoke',alignSelf:'flex-start',fontWeight:'lighter',marginLeft:'10px'}} to='/' >
               <h3>Dashboard</h3>
           </Link>
           <input className="search-bar" type="search" placeholder="Search a stock" onChange={(e)=>{
               suggestionList=search(e.target.value);
               console.log(suggestionList);
           }}/>
           <Link className="portf" style={{textDecoration:'none',color:'whitesmoke',alignSelf:'flex-end',fontWeight:'lighter',position:'absolute', right:'2vw'}} to="/portfolio">
               <h3>Go to portfolio</h3>
           </Link>
        </div>
    );
};

const mapStateToProps=state=>{
    return{
        products:state.trade.products
    }
    
}
export default connect(mapStateToProps)(Navbar);
